  .save((err) => {
    if (!err) console.log(`Notification job created: ${job.id}`);
  });

// Set up event listeners for the job
job.on('complete', () => {
  console.log('Notification job completed');
}).on('failed', () => {
  console.log('Notification job failed');
});

